import uuidv1 from 'uuid/v1';

export const submitFriendState = [
  {
    firstName: 'Martin',
    lastName: 'Scorsese',
    age: 76,
    id: uuidv1()
  },

  {
    firstName: 'Alfred',
    lastName: 'Hitchcock',
    age: 81,
    id: uuidv1(),
  },
  {
    firstName: 'Orson',
    lastName: 'Welles',
    age: 70,
    id: uuidv1(),
  },
];
